import React from 'react'
import Select from 'react-select'
const options = [
    { value: '1316168077', label: 'juan' },
    { value: '0956564582', label: 'Melanie' },
    { value: '646545564', label: 'Vanilla' }
  ]
const AddRegistro = () => {
  return (
    <div className='flex flex-col bg-white w-auto p-4 justify-between'>
        <label className='mt-4 mb-1' htmlFor="Cedula">Paciente</label>
        <Select options={options}/>
        <label className='mt-4 mb-1' htmlFor="Nombre">Nombre</label>
        <input className='w-96 border-b border-gray-600' type="text" name="Nombre" id="Nombre" minLength={1} maxLength={200} placeholder='Nombre del Paciente'/>
        <input className='m-auto w-2/3 my-6' type="submit" value="Agregar" />
    </div>
  )
}

export default AddRegistro
